import React from "react";
import {easeOut, motion} from "framer-motion"

const ballstyle={
    display: 'block',
    width: '1rem',
    height:'1rem',
    backgroundColor:'black',
    borderRadius: ".5rem"
}

const bouncetransition={
    y: {
        duration: 0.4,
        yoyo: Infinity,
        ease: "easeOut",
    }
}

export default function Ball(){
    return(
        <div
            style={{
                width:'2rem',
                heigth:'2rem',
                display:'flex',
                justifyContent:'space-around',
            }}>
                <motion.span style={ballstyle} transition={bouncetransition}></motion.span>
        </div>
    )
}
